import React from 'react';
import ReactDom from 'react-dom';

//css, this means the file is in the same folder, I.E the css folder
//is in the src folder with all the rest
import './index.css';

// nested components, React tools

//this is a like a function with no parameters
function BookList (){
return (
    <section className ='booklist'>
       <Book/>

    </section>

);
}

const Book =() =>{
    return( <article className='book'>
        <Image> </Image>
        <Title/>
        <Author/>
    </article>
    )

};
const Image = () =>(
   < img src ='https://images-na.ssl-images-amazon.com/images/I/81caWwaOOKL._AC_UL200_SR200,200_.jpg ' alt ='cover of Q.Ts book'/>

); 

const Title = ( )=> <h1>Once Upon a Time in Hollywood</h1>
const Author = () => <h4 style={
    {color:'#617d98',fontSize:'0.75rem',marginTop:'0.25rem'}

} >Quentin Tarantino</h4>

//this is an invocation
ReactDom.render(<BookList/>,document.getElementById('root'));
